import React from 'react';
import productimage1 from '../images/product1.png'
import productimage2 from '../images/product2.png'
import productimage3 from '../images/product3.png'
import productimage4 from '../images/product4.png'

// Sample product data
const products = [
  {
    id: 1,
    name: 'Product 1',
    category: '',
    rating: 4,
    image: productimage1,
  },
  {
    id: 2,
    name: 'Product 2',
    category: 'Category 2',
    rating: 3,
    image: productimage2,
  },
  {
    id: 3,
    name: 'Product 3',
    category: 'Category 3',
    rating: 5,
    image: productimage3,
  },
  {
    id: 4,
    name: 'Product 4',
    category: 'Category 4',
    rating: 4,
    image: productimage4,
  },
];

const FeaturedProducts = () => {
  return (
    <div className="container mx-auto py-12">
      <h2 className="text-2xl font-bold mb-6">Featured Products</h2>
      <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-4 gap-6">
        {products.map(product => (
          <div key={product.id} className="bg-white rounded-lg shadow-md overflow-hidden">
            <img src={product.image} alt={product.name} className="w-full h-40 object-cover" />
            <div className="p-4">
              <h3 className="text-lg font-semibold mb-2">{product.name}</h3>
              <p className="text-gray-600 mb-2">Category: {product.category}</p>
              <div className="flex mb-2">
                {[...Array(product.rating)].map((_, index) => (
                  <svg key={index} xmlns="http://www.w3.org/2000/svg" className="h-4 w-4 text-yellow-500" fill="none" viewBox="0 0 24 24" stroke="currentColor">
                    <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M12 5v14m-4-4h8" />
                  </svg>
                ))}
              </div>
              <p className="text-gray-500">ID: {product.id}</p>
            </div>
          </div>
        ))}
      </div>
    </div>
  );
};

export default FeaturedProducts;
